import React, { Component } from 'react'
import $ from "jquery";
import { withRouter } from "react-router-dom";

 class Pages extends Component {
    constructor(props) {
        super(props);
        this.state = {
            image: "../images/de.jpg",
            appcode:""
        }
    }
    componentDidMount() {
        const id = this.props.match.params.id;
        this.fetchData(id);
    }

    fetchData = id => {
        this.setState({appcode: id})
    };
    render() {
        
        return (
            <div>
                <img src='../images/de.jpg'></img>
                <div>{this.state.items}</div>
            </div>
        )
    }
}
export default withRouter(Pages)
